# Definition for singly-linked list.
class ListNode:
    def __init__(self, x):
        self.val = x
        self.next = None


class Solution:
    # @param head, a ListNode
    # @return a ListNode
    def getLast(self, head, n):
        i = 1
        while i < n and head.next:
            head = head.next
            i += 1
        return head

    def getEnd(self, head):
        while head.next:
            head = head.next
        return head

    def sortList(self, head):
        n = 0
        current = head
        while current:
            n += 1
            current = current.next
        step = 1
        while step < n:
            # print step
            start = head
            before_p1 = None
            while start:
                p1 = start
                last_p1 = self.getLast(p1, step)
                if last_p1.next is None:
                    break

                p2 = last_p1.next
                last_p1.next = None
                last_p2 = self.getLast(p2, step)
                after_p2 = last_p2.next
                last_p2.next = None

                p1 = self.merge(p1, p2)
                end = self.getEnd(p1)

                end.next = after_p2
                if before_p1 is None:
                    head = p1
                else:
                    before_p1.next = p1
                before_p1 = end
                start = after_p2
            step *= 2
        return head

    def merge(self, p1, p2):
        if p1 is None:
            return p2
        if p2 is None:
            return p1
        if p1.val < p2.val:
            head = p1
            p1 = p1.next
        else:
            head = p2
            p2 = p2.next
        current = head
        while p1 and p2:
            if p1.val < p2.val:
                current.next = p1
                p1 = p1.next
            else:
                current.next = p2
                p2 = p2.next
            current = current.next
        if p1:
            current.next = p1
        else:
            current.next = p2
        return head

